import React, { Component } from 'react';

class Header extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { headerImage } = this.props;

    let heroTitle = "Kontakta oss";

    return (
      <header id={headerImage} className="hero-image">
        <div className="hero-text">
          <h1 className="hero-title">
          {heroTitle}
          </h1>
          <p>Dagens lunch</p>
          <button className="todays-menu"> Se dagens </button>
        </div>
      </header>

      )
  }
}

export default Header;
